import React from 'react';

const post = (props)=>(
    <div>
        <h5>{props.name}</h5>
        <img src={props.image} alt=""/>
        <button >fav</button>
        <style jsx>
        {`
            h5{
            color: blue;
            }
            div {
            background: red;
            }
            @media (max-width: 600px) {
            div {
                background: grey;
            }
            }
        `}    
        </style>

    </div>
);



export default post;
